var moment=require("../../moment");exports.durationFromMoments={setUp:function(b){moment.createFromInputFallback=function(){throw new Error("input not handled by moment")};b()},"pure year diff":function(f){var d=moment("2012-01-01T00:00:00.000Z"),e=moment("2013-01-01T00:00:00.000Z");f.equal(moment.duration({from:d,to:e}).as("years"),1,"year moment difference");f.equal(moment.duration({from:e,to:d}).as("years"),-1,"negative year moment difference");f.done()},"month and day diff":function(g){var d=moment("2012-01-15T00:00:00.000Z"),f=moment("2012-02-17T00:00:00.000Z"),h=moment.duration({from:d,to:f});g.equal(h.get("days"),2);g.equal(h.get("months"),1);g.done()},"day diff, separate months":function(g){var d=moment("2012-01-15T00:00:00.000Z"),f=moment("2012-02-13T00:00:00.000Z"),h=moment.duration({from:d,to:f});g.equal(h.as("days"),29);g.done()},"hour diff":function(g){var d=moment("2012-01-15T17:00:00.000Z"),f=moment("2012-01-16T03:00:00.000Z"),h=moment.duration({from:d,to:f});g.equal(h.as("hours"),10);g.done()},"minute diff":function(g){var d=moment("2012-01-15T17:45:00.000Z"),f=moment("2012-01-16T03:15:00.000Z"),h=moment.duration({from:d,to:f});g.equal(h.as("hours"),9.5);g.done()}};